import React, { useState } from "react";

const Test2 = () => {
  const [divs, setDivs] = useState([1, 2, 3, 4, 5]);
  const [nextNum, setNextNum] = useState(6);

  const handleButtonClick = () => {
    setDivs(prevDivs => {
      const newDivs = [...prevDivs];
      newDivs.pop(); // usuwamy ostatni div
      newDivs.unshift(nextNum); // dodajemy nowy div na początek z następną liczbą
      return newDivs;
    });
    setNextNum(prevNum => prevNum + 1); // zwiększamy liczbę dla następnego diva
  };

  return (
    <div>
      <button onClick={handleButtonClick}>Usunąć i dodać div</button>
      {divs.map((num, i) => (
        <div key={i} style={{ height: "50px", width: "50px", backgroundColor: "lightblue", margin: "5px" }}>
          {num}
        </div>
      ))}
    </div>
  );
};
export default Test2;
